    return (
        <ContactFormStyled className='ContactForm'>
            <form>
                <div className="FormGroup">
                    <label htmlFor="userName">Name:</label>
                    <input id="userName"/>
                </div>
            </form>
        </ContactFormStyled>
    );
}

export default ContactForm;

const ContactFormStyled = styled.div`

